import "./index.css";

import { Todo } from "../../types";

interface FooterProps {
  calculateTotal: () => number;
  calculateFinished: () => number;
}

export default function Footer({
  calculateFinished,
  calculateTotal,
}: FooterProps) {
  const total = calculateTotal();
  const finished = calculateFinished();
  return (
    <div className="todo-footer">
      <label>
        <input type="checkbox" checked={calculateFinished === calculateTotal} />
      </label>
      <span>
        {" "}
        <span>Finished {calculateFinished()}</span> / Total: {calculateTotal()}
      </span>
      <button className="btn btn-danger">Delete Finished Tasks</button>
    </div>
  );
}
